import { Component, Injectable, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { OuterSubscriber } from 'rxjs/internal/OuterSubscriber';
import { GasModel } from 'src/app/Models/Gas_model';
import { Resume_model } from 'src/app/Models/Resume_model';
import { ModuleService } from 'src/app/Services/ModuleService';
import { ResumeService } from 'src/app/Services/ResumeTaskServer';

@Component({
  selector: 'app-gasfailed',
  templateUrl: './gasfailed.component.html',
  styleUrls: ['./gasfailed.component.css']
})
@Injectable({
  providedIn: 'root'
})
export class GasfailedComponent implements OnInit {

  public GasFailed_List:      GasModel[] = [];
  public StopMouseEnterAlarm: boolean = false;
  public IfSave = false;
  public dt = new Date();
  public ResumeToTask = new Resume_model();


  constructor(public S: ModuleService,public ResumeService: ResumeService ,public route : Router) { }

  ngOnInit(): void {
    this.S.ReturnGasFailedArrayIfback =this.S.ReturnGasFailedArray;
    this.GasFailed_List = this.S.ReturnGasFailedArray;
    this.GasFailed_List.map((x) => {
      x.OldAio=undefined;
      x.NewAio=undefined;
    });
    console.log(this.GasFailed_List);
  }

  Check_oldAIO()
  {
    if(this.StopMouseEnterAlarm == false)
    alert("pls verify old Ai/o Value == New Ai/o ");
     this.StopMouseEnterAlarm = true;
  }

  Calc_NewAio(val:any, name: any)
  {
      {
         this.GasFailed_List.map((x) =>{
           if(val != undefined &&  x.gasname == name)
           {
                 x.OldAio = val.target.value;
              if(x.Ac != undefined && x.target != undefined && x.OldAio != undefined)
                 x.NewAio = (x.Ac/x.target) * x.OldAio;        
           }
         });
      }  
  }

  Next()
  {
    let boolIf_fill = false
    this.GasFailed_List.map(x =>{
      if(x.gasname!= undefined && x.gasname != undefined && x.OldAio == undefined && x.NewAio == undefined)
      boolIf_fill = true;
    })
    if(boolIf_fill == false)
    {
      this.S.ReturnGasFailedArray = this.GasFailed_List;
      this.route.navigateByUrl("/Gas-After_Adj");
      this.S.ReturnGasAioArray = this.GasFailed_List;
    }

    else return;

  }

  Return_Back()
  {
    this.route.navigateByUrl("/Gas-List");
  }


  Save()
  {
    this.IfSave = true;
  }

  ToCancel()
  {
    this.IfSave = false;
    this.ResumeToTask.name = undefined;
    this.ResumeToTask.task = undefined;
  }

  async ToSave()
  {
    this.ResumeToTask.date = this.dt;
    this.ResumeToTask.router = this.route.url;

    try
    {
    const AddResume = await this.ResumeService.AddTaskToSaveResume(this.ResumeToTask);
    this.IfSave = false;
    this.ResumeToTask.name = undefined;
    this.ResumeToTask.task = undefined;
    }

    catch(ex: any)
    {
      alert(ex.message);
      this.IfSave = false;   
    }

  }

}
<div class="table">
    <h2>GAS  LIST</h2>
    <table>
       <tr>
           <th>GAS Name</th>
           <th>Gas-Line</th>
           <th>Old AI/o</th>
           <th class="AcResult">NEW AI/o</th>
       </tr>

       <tr *ngFor="let i of GasFailed_List">
        <td>{{i.gasname}}</td>
        <td>{{i.gasline}}</td>
        <td (mouseenter)="Check_oldAIO()"><input type="number" (change)="Calc_NewAio($event, i.gasname)"></td>                      
        <td>{{i.NewAio | number: '1.0-3'}}</td> 
       </tr>
    </table>   
</div> 



  <div class="content">
    <h2>Please Enter Old AI/O</h2>
    'NEXT' to Enter new AC Result <br />
    'SAVE' to continue later this step<br />
    'BACK' to return
</div>

<div class="buttons">
    <button class="Next" (click)="Next()">NEXT</button>
    <button class="Save" (click)="Save()">SAVE</button>
    <button class="Back" (click)="Return_Back()">BACK</button>
</div>

<div *ngIf="IfSave">

    <form #formInfo = "ngForm" class="save">
        Name
        <input type="text" class="NameProp" name="name" [(ngModel)]="ResumeToTask.name"
        required #nameInfo="ngModel">
        <br>
        Task
        <input type="text" class="TaskProp" name="task" [(ngModel)]="ResumeToTask.task"
        required #taskInfo="ngModel">
        <br>
        <input type="button" value="OK" class="IfOkToSave" [disabled]="formInfo.form.invalid" (click)="ToSave()" >
        <input type="button" value="Cancel" class="IfCancel" (click)="ToCancel()">
    </form>

</div>

<div class="If_MouseEnter">
    Please  Verify  Analog  is equal to 
</div>
